using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct UITagComponentResolver : IResolver<UITagComponent>, IResolver<UITagComponentResolver,UITagComponent>, IData	{		public UITagComponentResolver In(ref UITagComponent uitagcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetUITagComponent();			Out(ref local);		}		public void Out(ref UITagComponent uitagcomponent)		{		}	}}